script: |
  super -f text -I q11600.spq | sort > q11600.out

inputs:
  - name: q11600.spq
    data: |
      SELECT ALL + col1 * - 96 AS col1 FROM tab2 (FORMAT parquet) AS cor0 WHERE 6 NOT BETWEEN - - ( - 72 ) AND + 56 * - col2 + - col1 - + - CAST ( NULL AS INTEGER ) + - 26;
  - name: tab2

outputs:
  - name: q11600.out
    data: |
